            <tr>
                <td>{{ centre.id }}</td>
                <td>{{ centre.codi }}</td>
                <td>{{ centre.centre }}</td>
                <td>{{ centre.direccio }}</td>
                <td>{{ centre.localitat }}</td>
                <td>{{ centre.telefon }}</td>
                <td>{{ centre.query }}</td>
                <td>
